      SELECT DISTINCT + 63 * + tab0.col1 AS col2 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9833.out
    data: |
      5418
      5733
      6111
